}

fun();
`.trim();

const searchRange = `
function fun() {
  const nums = [5, 7, 7, 8, 8, 10];
  const target = 8;
  const result = [];

  for (let i = 0; i < nums.length; i++) {                  // Find the first occurrence
      if (nums[i] === target) {
          result[0] = i;
          break;
      }
  }

  for (let i = nums.length - 1; i >= 0; i--) {             // Find the last occurrence
      if (nums[i] === target) {
          result[1] = i;
          break;
      }
  }

  return result;
}

console.log(fun());  
`.trim();

const combinationSum = `
function combinationSum(){
  const arr=[1,2,3,6,4,5];
