                  code={compare_array}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />

              <h3>6. Sort Those Squares.</h3>

              <div style={titles}>
                <PrismCode
                  code={countElements}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
